import React from 'react';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { Container } from 'react-bootstrap';


import useStyles from './Footer-jss';

const Footer = () => {
  const classes = useStyles();

  return (
    <footer className={`${classes.footer} `}>
      <div className='container'>
        <div className='row'>
          <div className='col text-center'>
           
          <Container>
            <div className='footer my-4 text-center'>
              Made with{' '}
              <span role='img' aria-label='heart'>
                ❤️
              </span>{' '}
              <a
                href='https://github.com/AchrafHamrit/tellme'
                target='_blank'
                rel='noopener noreferrer'
              >{`<Github />`}</a>
            </div>
          </Container>

            <div className='message mt-3 mx-auto'>
              <p>
                As part of our common humanity, we could use some of our
                resources to help people who are not meeting their basic needs.
              </p>
            </div>
            
            <div className='Copyright mx-auto'>
              <p>Copy Rights &copy; Social Charities 2021</p>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
